import { Typography } from '@mui/material';
import NavBar from './components/AppBar';
import Cards from './components/Cards';
import Form from './components/Form.js';
import Modal_mui from './components/Modal_mui';
import Learn_mui from './components/Learnmui';


function App() {
  return (
    <>
      <NavBar />
      <Learn_mui />
      <Form />
      <Typography variant="h4" sx={{textAlign:'center'}} m={3}>card</Typography>
      <div style={{ display: 'flex' }}>

        <Cards />
        <Cards />
        <Cards />
        <Cards />
      </div>
      <br /><hr />
      <Modal_mui/>


    </>
  );
}

export default App;
